script: |
  super -f text -I q4065.spq | sort > q4065.out

inputs:
  - name: q4065.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col1 * + + col2 NOT IN ( - ( - - col2 ) * - 63 );
  - name: tab2

outputs:
  - name: q4065.out
    data: |
      46	51	23
      64	77	40
      75	67	58
